import { axiosInstance } from "./AxiosInstance"


export const login = async(data) =>{
    try{
        const response = await axiosInstance.post("http://localhost:8888/users/login", data);
        console.log(response);
        return response.data;
        
    }catch(err){
        console.log(err);
        return err.response.data;
    }
}

export const registerUser = async(data)=>{
    try{
        const response = await axiosInstance.post("http://localhost:8888/users/registerUser", data);
        return response.data;
    }catch(err){
        console.log(err);
        return err.response.data;
    }
}
